  //--------------------ABOUT--------------------
  ABOUT_TITLE: 'Internet das coisas facilitada. Visualize, conecte, controle e analise.',
  ABOUT_DESCRIPTIONFP: 'A plataforma ProIoT chegou ao mercado com o propósito de simplificar a tarefa ao conectar os objetos, transformando dados em informação.',
  ABOUT_DESCRIPTIONSP: 'Sempre buscando a melhor experiência, a infraestrutura robusta, escalável, segura e com design moderno, permite a criação das mais complexas aplicações utilizando IoT. Desta forma, em poucos cliques é possível realizar tarefas que antes demandavam profundos conhecimentos.',
  ABOUT_DESCRIPTIONTP: 'Resultado de uma sólida parceria entre o IMT (Instituto Mauá de Tecnologia) e a ProIoT, a plataforma permite a criação de todo um ecossistema de dispositivos, que podem compartilhar informações entre organizações e aplicações, combinando uma infinidade de dados e trazendo à superfície o que realmente interessa: A informação assertiva e até mesmo preditiva.',
  ABOUT_DESCRIPTIONTPFT: 'Além disso, a plataforma trata todos os dispositivos de maneira transparente, tornando seu parque homogêneo em termos de gerenciamento e conectividade. Seja uma prova de conceito, seja um projeto corporativo, a ProIoT possui as ferramentas certas para auxiliar e gerar economia a qualquer empresa ou projeto. Equipe, tecnologias, parceria, contato, localização.',
  //TEAM
  TEAM_TITLE: 'A Equipe ProIoT',
  TEAM_PARAGRAPHF: 'A equipe ProIoT é composta por pessoas experientes e comprometidas com o ambiente digital e a entrega de resultados de valor para os clientes.',
  TEAM_PARAGRAPHS: 'Do desenvolvimento à estratégia, uma vasta gama de qualificações e expertises para prover a melhor solução de objetos conectados do mercado.',
  //TECNOLOGY
  TECNOLOGY_TITLE: 'Tecnologia',
  TECNOLOGY_PARAGRAPHF: 'A plataforma ProIoT faz parte de um enorme ecossistema de internet das coisas que suporta e conecta todos os componentes de forma homogênea e transparente.',
  TECNOLOGY_PARAGRAPHS: 'Com interface simples e fácil de usar, permite gerenciar objetos conectados (dispositivos e sensores), protocolos de comunicação (roteadores, gateways, wi-fi, ethernet, entre outros), variáveis e expressões sintéticas, engines de Machine Learning e Estatística e gráficos em tempo real.',
  TECNOLOGY_PARAGRAPHT: 'Pensada para desenvolvedores, a plataforma oferece acesso via API e um marketplace para monetização de seus dados, hardwares, aplicações e soluções IoT, de forma plug-n-play.',
